import '../styles/Waitlist.css'

function Waitlist() {
    return (
        <main className='Waitlist'>
            <section className='content'>
                <h2>
                    Introducing Convo,
                    <br />
                    <span style={{color:'var(--light-text-color)'}}>Your social sidekick.</span>
                </h2>
            </section>
        </main>
    );
}

export default Waitlist;
